import { Container } from '@mui/system';
import React from 'react';
import Article from '../components/Article';
import NavbarLoggedIn from '../components/NavbarLoggedIn';

const ArticleDetail = () => {
  <Container maxWidth="lg">
    <NavbarLoggedIn />
    <Article />
  </Container>;
};

export default ArticleDetail;
